style.css:
@-moz-document url-prefix("https://www.quizlet.com/") {
/* Set background color for specific elements */
  .SetPage-setIntro,
  .SetPage-setIntroWrapper,
  .custom-cursor-default-hover,
  .TopNavigation,
  .s1p85o0s,
  .DashboardPage-main,
  .h1u362x1,
  .p1vmf404,
  .UIContainer,
  .DashboardPage-primaryContents {
    background-color: #ffe7f6 !important;
  }

  /* Set text color to #FFF for most elements */
  body:not(.TopNavigation-contentRight):not(.a3hscxe):not(.TopNavigation-menuItems):not(.LogoNavigationItem):not(.AssemblyInput) {
    color: #FFF !important;
  }

  /* Set text color for specific elements */
  .LogoNavigationItem,
  .custom-cursor-default-hover,
  .UserLink-username {
    color: #ff67cd !important;
  }
}
